#!/bin/bash
set -x
################################################################################
# File:    buildDocs.sh
# Purpose: Script that builds our documentation using sphinx and updates GitHub
#          Pages. This script is executed by:
#            .github/workflows/docs_pages_workflow.yml
#
# Authors: Qian Luo
# Created: 2021-07-02
# Updated: 2020-07-08
# Version: 0.0
################################################################################
 
###################
# INSTALL DEPENDS #
###################
 
apt-get update
apt-get -y install git rsync python3-sphinx python3-sphinx-rtd-theme python3-stemmer python3-git python3-pip python3-virtualenv 
 
python3 -m pip install --upgrade rinohtype pygments
 
#####################
# DECLARE VARIABLES #
#####################
 
pwd
ls -lah
export SOURCE_DATE_EPOCH=$(git log -1 --pretty=%ct)
# make a new temp dir which will be our GitHub Pages docroot
docroot=`mktemp -d`
 
export REPO_NAME="${GITHUB_REPOSITORY##*/}"

##############
# BUILD DOCS #
##############
 
# first, cleanup any old builds' static assets
make -C docs clean
# get a list of branches, excluding 'HEAD' and 'gh-pages'
versions="`git for-each-ref '--format=%(refname:lstrip=-1)' refs/remotes/origin/ | grep -viE '^(HEAD|gh-pages)$'`"

for current_version in ${versions}; do
  
   # make the current language available to conf.py
   export current_version
   git checkout ${current_version}
  
   echo "INFO: Building sites for ${current_version}"
  
   # skip this branch if it doesn't have our docs dir & sphinx config
   if [ ! -e 'docs/source/conf.py' ]; then
      echo -e "\tINFO: Couldn't find 'docs/conf.py' (skipped)"
      continue
   fi
  
   languages="en `find docs/source/locale/ -mindepth 1 -maxdepth 1 -type d -exec basename '{}' \;`"
   for current_language in ${languages}; do
  
      # make the current language available to conf.py
      export current_language
      ##########
      # BUILDS #
      ##########
      echo "INFO: Building for ${current_language}"
  
      # HTML #
      sphinx-build -b html docs/source docs/build/html/${current_language}/${current_version} -D language="${current_language}"
 
  
      # copy the static assets produced by the above build into our docroot
      rsync -av "docs/build/html/" "${docroot}/"
  
   done
  
done

# return to master branch
git checkout master

#######################
# Update GitHub Pages #
#######################
 
git config --global user.name "${GITHUB_ACTOR}"
git config --global user.email "${GITHUB_ACTOR}@users.noreply.github.com"

pushd "${docroot}"
 
# don't bother maintaining history; just generate fresh
git init
git remote add deploy "https://token:${GITHUB_TOKEN}@github.com/${GITHUB_REPOSITORY}.git"
git checkout -b gh-pages
 
# add .nojekyll to the root so that github won't 404 on content added to dirs
# that start with an underscore (_), such as our "_content" dir..
touch .nojekyll

# add redirect from the docroot to our default docs language/version
cat > style.css <<EOF

body {
    font-family: 'Didact Gothic', sans-serif;
    color:#333;
        box-sizing: border-box;
}

* {
    box-sizing: border-box;
}

a {
    text-decoration: none;
}

header {
   
    background-color: #f2f2f2;
    height: 110px;
    padding: 10px 0;
    
}

nav {
    width: 960px;
    margin: 0 auto;
    display: flex;
    justify-content: space-between;
}

.logo {
    width: 100px;
}

.logo img {
    width: 100px;
    
}

.dropbtn {
  color: black;
  padding: 16px;
  font-size: 16px;
  border: none;
}

.dropdown {
  position: relative;
  display: inline-block;
}

.dropdown-content {
  display: none;
  position: absolute;
  background-color: #f1f1f1;
  min-width: 160px;
  box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
  z-index: 1;
}

.dropdown-content a {
  color: black;
  padding: 12px 16px;
  text-decoration: none;
  display: block;
}

.dropdown-content a:hover {background-color: #ddd;}

.dropdown:hover .dropdown-content {display: block;}

.dropdown:hover .dropbtn {background-color: #3e8e41;}

EOF

cat > index.html <<EOF
<!DOCTYPE html>
<!-- saved from url=(0040)https://qianqianluo.github.io/test-docs/ -->
<html lang="en"><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
    
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Tigase documentation main page</title>
    <link rel="stylesheet" href="./Tigase documentation main page_files/style.css">
</head>
 
<body>
<h1 style="color:blue;"> Welcome to Tigase Documentation Website</h1>
    <header>
        <nav>
            <div class="logo">
                <a href="https://qianqianluo.github.io/test-docs/#"><img src="data:image/png;base64, " alt="Logo" /></a>
            </div>
            <div class="dropdown">
                <button class="dropbtn"><img src="https://www.countryflags.io/us/flat/32.png" style="vertical-align:middle"> ENGLISH</button>
                <div class="dropdown-content">
                    <a href="https://qianqianluo.github.io/test-docs/pl/master/"><img src="https://www.countryflags.io/pl/flat/32.png" style="vertical-align:middle"> POLISH</a><br/>
                    <a href="https://qianqianluo.github.io/test-docs/en/master/"><img src="https://www.countryflags.io/us/flat/32.png" style="vertical-align:middle"> ENGLISH</a><br/>
                    <a href="https://qianqianluo.github.io/test-docs/zh_CN/master/"><img src="https://www.countryflags.io/cn/flat/32.png" style="vertical-align:middle"> CHINESE</a>
                </div>
            </div>
            <!--
            <div class="lang-menu">
                <div class="selected-lang">
                    English
                </div>
                <ul>
                    <li>
                        <a href="https://qianqianluo.g7/29/2021ithub.io/test-docs/pl/master/" class="pl">POLISH</a>
                    </li>
                    <li>
                        <a href="https://qianqianluo.github.io/test-docs/en/master/" class="en">ENGLISH</a>
                    </li>
                    <li>
                        <a href="https://qianqianluo.github.io/test-docs/zh_CN/master/" class="cn">CHINESE</a>
                    </li>
                </ul>
            </div>
            -->
        </nav>
    </header>




</body></html>
EOF

# copy the resulting html pages built from sphinx above to our new git repo
git add .
 
# commit all the new files
msg="Updating Docs for commit ${GITHUB_SHA} made on `date -d"@${SOURCE_DATE_EPOCH}" --iso-8601=seconds` from ${GITHUB_REF} by ${GITHUB_ACTOR}"
git commit -am "${msg}"
 
# overwrite the contents of the gh-pages branch on our github.com repo
git push deploy gh-pages --force
 
popd # return to main repo sandbox root
 
# exit cleanly
exit 0